    "mercury-in-largemouth-bass-and-other-fishes-of-the-merritt-island-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "From August 16 to 22, 1990, largemouth
    bass (Micropterus salmoides), bowfin (Amia calva) and spotted seatrout (Cynoscion
    nebulosus) were collected from selected locations at the Merritt Island National
    Wildlife Refuge, Brevard County, Florida for analysis of mercury concentrations
    in muscle tissue (fillets). Thirty-three largemouth bass were collected. They ranged
    in length from 260 to 540 mm (10.221.3 in) and had mercury levels ranging from 0.07
    to 1.34 mg/kg wet weight; ppm. Fifty-two percent of the bass had levels that exceeded
    the Florida limited-consumption concentration of 0.5 ppm wet weight. Three bowfin
    ranged from 500 to 610 mm (19.7 to 24.0 in) in length and had mercury concentrations
    in fillets ranging from 0.38 to 1.48 ppm. Six spotted seatrout were from 440 to
    633 mm (17.3 to 24.9 in) in length. Mercury levels (range = 0.58 to 1.41 ppm) in
    all seatrout exceeded the State of Florida's limited-consumption concentration.
    None of the fish analyzed contained concentrations which exceeded the State's no-consumption
    concentration (1.5 ppm). All locations sampled appeared to provide environments
    conducive for accumulation of mercury in largemouth bass, bowfin or spotted seatrout.
    However, concentrations in bass were much greater (p<0.001) at three sampling stations
    (the pond at the rear of the Visitor's Center, Pond B-16 and Coquina Pond #2)- than
    at other locations. Several fish and wildlife trust species may be at risk when
    utilizing the habitat areas sampled. Additional environmental contaminant studies
    to determine the scope, magnitude and effects of mercury contamination are recommended.",nt"license_title":
